import React, {useState} from 'react';
import {Button, Container} from "react-bootstrap";
import CreateApplication from "../components/modals/CreateApplication";
import CreateDeveloper from "../components/modals/CreateDeveloper";
import CreateType from "../components/modals/CreateType";

const Admin = () => {
    const [applicationVisible, setApplicationVisible] = useState(false)
    const [typeVisible, setTypeVisible] = useState(false)
    const [developerVisible, setDeveloperVisible] = useState(false)
    return (
        <Container className="d-flex flex-column">
            <Button variant={"outline-dark"} className="mt-4 p-2">Добавить тип</Button>
            <Button variant={"outline-dark"} className="mt-4 p-2">Добавить бренд</Button>
            <Button variant={"outline-dark"} className="mt-4 p-2">Добавить устройство</Button>

            <CreateApplication show={applicationVisible}/>
            <CreateDeveloper show={developerVisible}/>
            <CreateType show={typeVisible}/>
        </Container>
    );
};

export default Admin;
